define('../../../../../player/_base/js/components/tooltipster',[
	"jquery",
	"tooltipster"
	], function($) {

	var tooltipster = function() {
		$('.mbTooltip').each(function(i, item) {
			var item = $(item),
				config = item.data(),
				content_el = null;

			if (config.content) {
				content_el = $(config.content);
				if (content_el.length) {
					config.content = content_el;
				}
			}

			if (item.find('.mbTooltip').length) {
				item.attr('title', '');
			}

			if (!item.attr('title')) return;

			item.tooltipster(config);
		});
	}

	return tooltipster;
});

define('../../../../../player/_base/js/scorm/initScorm',[], function() {
	'use strict';
	var initScorm = function() {
		var config = Player.Config.general.scorm,
			wrapper = Player.Scorm.Wrapper,
			queryScorm = Player.Helpers.getQueryVariable('scorm'),
			jsonScorm = Player.json.courseScorm,
			scorm = queryScorm === false || jsonScorm === false ? false : true,
			suspendedData;

		Player.Scorm.vars = {
			"cmi.core.lesson_location": undefined,
			"cmi.core.lesson_status": undefined,
			"cmi.core.score.raw": undefined,
			"cmi.suspend_data": {}
		};

		if (scorm === false) return;

		wrapper.doLMSInitialize();
		Player.Scorm.readScormVars();

		suspendedData = Player.Scorm.getScormValue('cmi.suspend_data');

		$(window).on({
			beforeunload: function() {
				Player.Scorm.saveScormData(true);
			},

			unload: function() {
				Player.Scorm.saveScormData(true);
			}
		});

		console.log(Player);
	}

	return initScorm;
});

define('../../../../../player/_base/js/scorm/getScormValue',[], function() {

	var getScormValue = function(scormVar, susDataVar) {
		var scormVars = Player.Scorm.vars;

		for (var key in scormVars) {
			if (scormVars.hasOwnProperty(key)) {
				console.log(key, scormVar);
				if (key === scormVar) {
					if (scormVar === 'cmi.suspend_data' && susDataVar) {
						return scormVars[key][susDataVar];
					} else {
						return scormVars[key];
					}
					break;
				}
			}
		}
	}

	return getScormValue;
});

define('../../../../../player/_base/js/scorm/setScormValue',[], function() {
	var setScormValue = function(scormVar, value, susDataVar) {
		var scormVars = Player.Scorm.vars;

		for (var key in scormVars) {
			if (scormVars.hasOwnProperty(key)) {
				if (key === scormVar) {
					if (scormVar === 'cmi.suspend_data' && susDataVar) {
						scormVars[key][value] = susDataVar;
					} else if (scormVar === "cmi.core.lesson_location" && value > (Player.Tree.slides.length - 1)) {
						scormVars[key] = Player.Tree.slides.length - 1;
					} else {
						scormVars[key] = value;
					}
					break;
				}
			}
		}
	}

	return setScormValue;
});

