define('../../../../../player/_base/js/scorm/wrapper/convertTotalSeconds',[], function() {
	var convertTotalSeconds = function(ts) {
		var sec,
			tmp,
			strSec,
			strWholeSec,
			strFractionSec,
			rtnVal,
			hour,
			min;

		sec = (ts % 60);
		ts -= sec;
		tmp = (ts % 3600); //# of seconds in the total # of minutes
		ts -= tmp; //# of seconds in the total # of hours

		// convert seconds to conform to CMITimespan type (e.g. SS.00)
		sec = Math.round(sec * 100) / 100;

		strSec = new String(sec);
		strWholeSec = strSec;
		strFractionSec = "";

		if (strSec.indexOf(".") != -1) {
			strWholeSec = strSec.substring(0, strSec.indexOf("."));
			strFractionSec = strSec.substring(strSec.indexOf(".") + 1, strSec.length);
		}

		if (strWholeSec.length < 2) {
			strWholeSec = "0" + strWholeSec;
		}
		strSec = strWholeSec;

		if (strFractionSec.length) {
			strSec = strSec + "." + strFractionSec;
		}

		if ((ts % 3600) != 0)
			hour = 0;
		else hour = (ts / 3600);
		if ((tmp % 60) != 0)
			min = 0;
		else min = (tmp / 60);

		if ((new String(hour)).length < 2)
			hour = "0" + hour;
		if ((new String(min)).length < 2)
			min = "0" + min;

		rtnVal = hour + ":" + min + ":" + strSec;

		return rtnVal;
	}

	return convertTotalSeconds;
});

define('../../../../../player/_base/js/helpers/namespace',[], function() {
	var namespace = function(obj, ns) {

		console.log(ns);
		window[obj] = window[obj] || {};

		var namespaceIt = function(ns_string) {

			var parts = ns_string.split('.'),
				parent = window[obj],
				i;

			if (parts[0] === obj) {
				parts = parts.slice(1);
			}
			for (i = 0; i < parts.length; i += 1) {
				if (typeof parent[parts[i]] === "undefined") {
					parent[parts[i]] = {};
				}
				parent = parent[parts[i]];
			}
			return parent;
		}

		if (typeof ns === 'string') {
			namespaceIt(ns);
		} else if (typeof ns === 'object') {
			for (var i = ns.length - 1; i >= 0; i--) {
				namespaceIt(ns[i]);
			};
		}
	};

	return namespace;
});

