define('../../../../_baseClient/_base/js/desktop/slides/slideFinal/player',[
	'jquery'
], function($) {

	var slideFinalPlayer = function() {
		this.init = function() {
			var me = this,
				$msgNotaFinal = $('<b>Voc acertou <span class="notaFinalUsuario"></span>% das questes.</b>').hide(),
				$notaFinal = $msgNotaFinal.find('.notaFinalUsuario');

			Player.Elements.$content.on({
				contentReady: function(e) {
					me.$el.find('.textoCaixaDestaque').append($msgNotaFinal);

					if (me.hasAtividade()) {
						$notaFinal.html(me.getNotaFinal());
						$msgNotaFinal.show();
					}
				},

				atividadeRespondida: function() {
					$notaFinal.html(me.getNotaFinal());
				}
			});
		}

	}

	slideFinalPlayer.prototype.hasAtividade = function() {
		var me = this,
			atividades_com_nota = $.grep(Player.Functions.findResource.find('atividade'), function(atividade) {
				return atividade.data.nota.subType == 'comNota';
			}),
			has_atividade = !!atividades_com_nota.length;

		// sobrescreve o mtodo prototipado para que retorne diretamente true ou false,
		// pois nao precisamos iteragir em todas atividades com nota novamente
		slideFinalPlayer.prototype.hasAtividade = function() {
			return has_atividade;
		}

		return has_atividade;
	}

	slideFinalPlayer.prototype.getNotaFinal = function() {
		return (Player.Scorm.getScormValue('cmi.core.score.raw') || 0);
	}

	return slideFinalPlayer;
});

