define('../../../../_baseClient/_base/js/desktop/resources/atividade/player',[], function() {
	var base_atividade = function() {
		this.init = function() {
			/*Checar Funo compile para observar que objetos so atrelados ao objeto principal
			- this.template
			- this.data
			- this.compiled
			- this.el
			- this.$el
			*/

			$.extend(true, this, new Player.Helpers.resourceExtend(this, arguments));

			var recurso = this,

				$btnEnviaResposta = this.$el.find('.enviaResposta'),
				$chkOrRadio = this.$el.find('.chkOrRadio'),
				$serverMsg = this.$el.find('.serverMsg'),
				$checkOnDiv = this.$el.find('.checkOnDiv'),
				$inputCheck = this.$el.find('input[type=checkbox]'), //corrigir bug do checkOnDiv
				$inputRadio = this.$el.find('input[type=radio]'), //corrigir bug do checkOnDiv
				scoAtividade = recurso.data.nota.subType,
				feedBackModal = recurso.data.feedback.modal,
				feedBackCircundado = recurso.data.feedback.circundado,
				gabarito = recurso.data.parametros.gabarito;

			function highlightRows() {
				$.each($checkOnDiv.parent(), function(i, div) {
					$(div).toggleClass('selected', $chkOrRadio.eq(i).is(':checked'));
				});
			}

			// propriedade scorm
			recurso.scorm = {
				respostas: []
			};

			Player.Elements.$content.on({
				scormReady: function() {
					var id_atividade = recurso.$el.attr('id'),
						atvs_scorm = Player.Scorm.getScormValue('cmi.suspend_data').atividade || {},
						feedback_modal_bkp = feedBackModal;

					$.extend(true, recurso.scorm, atvs_scorm[id_atividade]);
					
					if (!recurso.isAnswered()) return;

					// atividade j respondida

					feedBackModal = false; // apenas para no mostrar as janelas modais de feedback

					// pre-seleciona as opes gravadas no scorm
					$.each(recurso.scorm.respostas, function(i, resposta) {
						$chkOrRadio.filter('[value="' + resposta + '"]').prop('checked', true);
					});
					recurso.enviaResposta();

					// restaura o valor de feedBackModal
					feedBackModal = feedback_modal_bkp;
				},

				contentReady: function(e) {
					var slidesLength = Player.Tree.slides.length,
						comNota = recurso.data.nota.subType == 'comNota';

					if (comNota && recurso.getSlideNumber() == Player.Elements.swipe.getPos() && !recurso.isAnswered()) {
						recurso.lockPlayer(true);
					}

					if (comNota && recurso.isAnswered()) {
						recurso.$el.addClass('disabled');
						$chkOrRadio.prop('disabled', true);
						$btnEnviaResposta.hide();
					}
				}
			});

			Player.Elements.$swipe.on({
				slideInit: function(e, startIndex, endIndex, domInit, domEnd) {
					if (recurso.data.nota.subType == 'comNota' && recurso.getSlideNumber() == endIndex && !recurso.isAnswered()) {
						recurso.lockPlayer(true);
					}
				},
				slideEnd: function(e, startIndex, endIndex, domInit, domEnd) {

					var slidesLength = Player.Tree.slides.length,
						lastSlide = Player.Tree.slides[slidesLength - 1];

					// if (lastSlide.hasAtividade) {
					// 	lastSlide.hasAtividade(endIndex);
					// }
					if (recurso.data.nota.subType == 'comNota' && recurso.getSlideNumber() == endIndex && !recurso.isAnswered()) {
						recurso.lockPlayer(true);
					}
				}
			});

			// ************************* MODAIS FEEDBACK ************************* 

			var feedback_certo = Player.Elements.generalModal.add(recurso, Player.Config.general.modal, {
				id: recurso.data.id + 'feedbackCerto',
				dataId: 'feedbackCerto',
				actions: {
					"click .btnFechar": function() {
						Player.Elements.generalModal.hide();
					}
				},
				content: "#modalContent"
			});

			var feedback_errado = Player.Elements.generalModal.add(recurso, Player.Config.general.modal, {
				id: recurso.data.id + 'feedbackErrado',
				dataId: 'feedbackErrado',
				actions: {
					"click .btnFechar": function() {
						Player.Elements.generalModal.hide();
						// Player.Elements.generalModal.hide(feedback_errado); //retirado, pois ie no fechava modal
					}
				},
				content: "#modalContent"
			});

			// ************************* EVENTOS ************************* 

			$chkOrRadio.on({
				click: function() {
					if ($('.chkOrRadio').is(':checked')) {
						$btnEnviaResposta.off('click'); //utilizado para no chamar a funo "ativaBtnResposta()", pela quantidade de alternativas assinaladas, mas apenas uma vez.
						recurso.ativaBtnResposta();
					} else {
						recurso.desativaBtnResposta();
						$btnEnviaResposta.off('click');
					}
				},

				change: function() {
					highlightRows();
				}
			});

			$checkOnDiv.on({
				click: function() {

					if (recurso.$el.hasClass('disabled')) return;

					var checkbox = $(this).find('input[type=checkbox]'),
						radiobox = $(this).find('input[type=radio]');

					checkbox.prop("checked", !checkbox.prop("checked"));
					radiobox.prop("checked", !radiobox.prop("checked"));

					if ($checkOnDiv.find('.chkOrRadio').is(':checked')) {
						$btnEnviaResposta.off('click');
						recurso.ativaBtnResposta();
					} else {
						$btnEnviaResposta.off('click');
						recurso.desativaBtnResposta();
					}

					highlightRows();
				}
			});

			//corrigir bug do checkOnDiv
			$inputCheck.on({
				click: function(e) {
					e.stopPropagation();
					return true;
				}
			});
			//corrigir bug do checkOnDiv
			$inputRadio.on({
				click: function(e) {
					e.stopPropagation();
					return true;
				}
			});

			// ************************* FUNES ************************* 

			this.isAnswered = function() {
				return (recurso.scorm.respostas.length > 0);
			}

			this.ativaBtnResposta = function() {
				$btnEnviaResposta.removeClass('desativado');
				$btnEnviaResposta.on('click', this.enviaResposta);
			}

			this.desativaBtnResposta = function() {
				$btnEnviaResposta.addClass('desativado');
			}

			this.enviaResposta = function() {
				var id_atividade = $(this).parent().attr('id'),
					checked_options = recurso.$el.find(".chkOrRadio:checked"),
					answers = $.map(checked_options, function(option) {
						return $(option).val();
					}),
					atvs_scorm = Player.Scorm.getScormValue('cmi.suspend_data').atividade,
					atv_scorm = {},
					correct_answer,
					average_score;

				if (scoAtividade == "comNota") {
					$chkOrRadio.prop('disabled', true);
					$btnEnviaResposta.hide();
					$serverMsg.css('display', 'block');

					recurso.$el.addClass('disabled');
				}

				// unlock player next button
				recurso.lockPlayer(false);

				// prepare to save into scorm
				recurso.scorm.respostas = answers;
				atv_scorm[id_atividade] = recurso.scorm;

				// checaResposta() e calculaMedia() devem vir DEPOIS de ter sido setada a variavel `recurso.scorm.respostas`
				correct_answer = recurso.checaResposta();
				average_score = recurso.calculaMedia();

				// save into scorm
				Player.Scorm.setScormValue('cmi.suspend_data', 'atividade', $.extend(true, {}, atvs_scorm, atv_scorm));

				// save average score
				Player.Scorm.setScormValue('cmi.core.score.raw', average_score);

				// show feedback message
				recurso.showFeedBack(correct_answer);

				Player.Elements.$content.trigger('atividadeRespondida');
			}

			/**
			 * retorna true quando as respostas escolhidas baterem com o gabarito
			 * @return {BOOLEAN} true atividade respondida corretamente
			 */
			this.checaResposta = function() {
				var checked_options = recurso.$el.find(".chkOrRadio:checked"),
					answers = $.map(checked_options, function(option) {
						return $(option).val();
					});

				return answers.compare(gabarito);
			}

			this.showFeedBack = function(correct) {
				var feedBackVisual = recurso.$el.find(".chkOrRadio");

				if (feedBackCircundado) {
					// assinala as opes corretas e erradas
					$.each(feedBackVisual, function(i, option) {
						var option = $(option),
							correct_option = ($.inArray(option.val(), gabarito) >= 0);

						option.parents('li:first')
							.toggleClass('certo', correct_option)
							.toggleClass('errado', !correct && !correct_option);
					});
				}

				// se for o caso, mostra o modal
				if (feedBackModal) {
					Player.Elements.generalModal.show(recurso.data.id + (correct ? 'feedbackCerto' : 'feedbackErrado'));
				}

			}

			this.calculaMedia = function() {
				var atividades = Player.Functions.findResource.find('atividade'),
					// somente atividades "comNota"
					atividades_com_nota = $.grep(atividades, function(atividade) {
						return (atividade.data.nota.subType == 'comNota');
					}),
					// somente as atividades comNota respondidas corretamente
					atividades_corretas = $.grep(atividades_com_nota, function(atividade) {
						return atividade.isAnswered() && atividade.checaResposta();
					}),
					total_com_nota = atividades_com_nota.length,
					media = !total_com_nota ? 0 : (atividades_corretas.length / total_com_nota) * 100;

				return Number(media.toFixed(0));
			}

		}

	}

	return base_atividade;
});

